  //   );
  //   const jsondata = await response.json();
  //   setFake(jsondata);
  // };
  // fakestore();
  render() {
    return (
      <div className="product-page">
        <Header name="Priya" />
        <div className="product-c">
          {/* {fake.map((values) => {
          return (
            <Link to="/product-name">
              <Photobook img={values.image} desc={values.title} />
            </Link>
          );
        })} */}
        </div>
        <BottomNavbar />
      </div>
    );
  }
}
